function pay(code) {
    top.db.transaction(function (tx) {
        tx.executeSql('SELECT * FROM CARD where code = ?', [code], function (tx, results) {
            var len = results.rows.length;
            if (len === 1 && total > 0) {
                if (total > Number(results.rows.item(0).quota)) {
                    goods = new Map();
                    total = 0;
                    $("#totalP").hide();
                    $("#mainBody").html("");
                    top.speak("用户余额不足");
                } else {
                    tx.executeSql('SELECT * FROM POOL', [], function (tx, poolResult) {
                        if ("1" === results.rows.item(0).type) {
                            //共享支付
                            if (poolResult.rows.length === 1) {
                                if ((total + Number(poolResult.rows.item(0).consume)) > Number(poolResult.rows.item(0).amount)) {
                                    top.speak("资金池余额不足");
                                    return;
                                } else {
                                    let consume = total + Number(poolResult.rows.item(0).consume);
                                    tx.executeSql("update POOL set consume = ?  where id = ? ", [consume + "", poolResult.rows.item(0).id],
                                        function () {
                                            console.info("更新资金池余额成功！");
                                        },
                                        function (tx, result) {
                                            console.info("更新资金池余额失败:" + result.message);
                                        });
                                }
                            } else {
                                top.speak("资金池未初始化");
                                return;
                            }
                        }
                        for (let good of goods.values()) {
                            let goodTotal = top.accMul(good.num, good.price, 2);
                            tx.executeSql('INSERT INTO DETAIL (id,cardcode,goodscode,num,price,amount,createtime) VALUES (?, ?, ?, ?, ?, ?, ?)',
                                [Date.now() + 100 * Math.random(), code, good.code, good.num + "", good.price + "", goodTotal + "", Date.now() + ""],
                                function () {
                                    console.info("添加商品【" + good.name + "】的消费明细成功！")
                                },
                                function (tx, result) {
                                    console.info("添加商品【" + good.name + "】的消费明细失败:" + result.message)
                                });
                            let stock = Number(good.stock) - Number(good.num);
                            tx.executeSql("update GOODS set num = ?  where code = ? ", [stock + "", good.code],
                                function () {
                                    console.info("更新商品【" + good.name + "】的库存成功！")
                                },
                                function (tx, result) {
                                    console.info("更新商品【" + good.name + "】的库存失败:" + result.message)
                                });
                        }
                        let quota = Number(results.rows.item(0).quota) - total;
                        tx.executeSql("update CARD set quota= ?  where code = ? ", [quota + "", code],
                            function () {
                                console.info("更新用户余额成功！")
                            },
                            function (tx, result) {
                                console.info("更新用户余额失败:" + result.message)
                            });
                        goods = new Map();
                        total = 0;
                        $("#totalP").hide();
                        $("#mainBody").html("");
                        top.speak("支付成功");
                        document.querySelector('#mainBody ').scroll(0,100)
                        // new Audio("aliPay250.wav").play();
                    }, null);
                }
            } else {
                addGood(code);
            }
        }, null);
    });
}

function numChange(code) {
    if (Number($("#num_" + code).val()) > Number(goods.get(code).stock)) {
        $("#num_" + code).val(goods.get(code).num);
        top.speak("商品" + goods.get(code).name + "库存不足");
    } else {
        goods.get(code).num = $("#num_" + code).val();
        $("#sumgoods"+code).html(toDecimal(top.accMul(goods.get(code).num, goods.get(code).price, 2)))
        calculate();
    }
}

function calculate() {
    total = 0;
    for (let good of goods.values()) {
        let goodTotal = parseFloat(top.accMul(good.num, good.price, 2));
        $("#total_" + good.code).text(goodTotal);
        total += goodTotal;
    }

    $("#total").text(toDecimal(total));
    $("#totalP").show();
}


//强制保留两位小数
function toDecimal(x) {
    var f = parseFloat(x);
    if (isNaN(f)) {
        return false;
    }
    var f = Math.round(x * 100) / 100;
    var s = f.toString();
    var rs = s.indexOf('.');
    if (rs < 0) {
        rs = s.length;
        s += '.';
    }
    while (s.length <= rs + 2) {
        s += '0';
    }
    return s;
}
